    .sidebar li:nth-child(1) {
      transition: all 0.5s ease 0.2s;
    }
  
    .sidebar li:nth-child(2) {
      transition: all 0.5s ease 0.4s;
    }
  
    .sidebar li:nth-child(3) {
      transition: all 0.5s ease 0.6s;
    }
  
    .sidebar li:nth-child(4) {
      transition: all 0.5s ease 0.8s;
    }
  
    .sidebar li:nth-child(5) {
      transition: all 0.5s ease 1s;
    }
  
    li.fade {
      opacity: 1;
    }
  
    .container {
      height: 100vh;
      width: 100%;
      margin-right: auto;
      margin-left: 0;
      float: left;
    }
  
    .about-container {
      height: 100%;
      width: 100%;
    }
    .about-container .paragraph-positioning {
      position: relative;
      top: 50%;
      transform: translateY(-50%);
    }
  
    .section-positioning {
      height: 100%;
      width: 100%;
    }
    .section-positioning .paragraph-positioning {
      position: relative;
      top: 20%;
      transform: translateY(-20%);
    }
  
    .wrapper {
      width: 100%;
      height: auto;
    }
    .wrapper img {
      width: 100%;
      height: auto;
    }
  
    .cube-img {
      display: none;
    }
    .cube-img img {
      display: none;
    }
  
    .overlay {
      display: none;
    }
  
    .overlay-phone {
      display: none;
    }
  
    .overlay-pics {
      display: none;
    }
  
    .vid-display {
      display: block;
    }
  
    h3 {
      font-size: 1.5rem;
    }
  
    .contact-font {
      font-size: 0.5rem;
      color: #333333;
    }
  }
  @media screen and (max-width: 500px) {
    .section-positioning {
      height: 100%;
      width: 100%;
    }
    .section-positioning .paragraph-positioning .img-container {
      display: none;
    }
    .section-positioning .each-list:hover {
      font-size: 1.6em;
      animation: shake 0;
    }
    .section-positioning .link-list:hover {
      color: #333333;
      text-shadow: none;
    }
  
    .pro-img img {
      height: auto;
      min-width: 150px;
    }
  }
  .future-update {
    display: none;
  }
  
